/** @format */

const axios = require("axios");

const baseUrl = "http://localhost:8080/api/inventory";

export const getItems = () => {
  axios.get(baseUrl).then(
    function (response) {
      // handle success
      console.log(response);
    },
    (error) => {
      console.log(error);
    }
  );
};
